import java.util.Arrays;
import java.util.Scanner;

class  Main {

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int m = sc.nextInt();
        long[] giftSizes = new long[n];
        long[] wrapSizes = new long[m];
        for (int i = 0; i < giftSizes.length; i++) {
            giftSizes[i] = sc.nextLong();
        }

        for (int i = 0; i < wrapSizes.length; i++) {
            wrapSizes[i] = sc.nextLong();
        }
        Arrays.sort(giftSizes);
        Arrays.sort(wrapSizes);

        int i = 0;
        int j = 0;
        int count = 0;

        while (i < n && j < m) {
            if (wrapSizes[j] >= giftSizes[i]*2 && wrapSizes[j] <= giftSizes[i]*3) {
                count++;
                i++;
                j++;
            } else if (wrapSizes[j] > giftSizes[i]*3) {
                i++;
            } else {
                j++;
            }
        }
        System.out.println(count);

    }
}
